import React from "react";
import {Link} from 'react-router-dom';

const Navbar = () =>{
    return (
        <nav style={{background: "#fff" , marginBottom: "2rem"}} className="navbar navbar-expand-lg fixed-top navbar-light border-bottom border-info">
          <div className="container">
            <Link className="navbar-brand" to="http://www.masterkeegroup.com">Masterkee Group</Link>
            
          </div>
        </nav>
    );
  
}

export default Navbar;
